import React from 'react'
import "./DialogBox.css"
import Weather from "../../Media/weather.png";
const DialogBox = () => {
  return (
    <div class="dialog-container">
      <h1 style={{ color: "#FFFFFF", textAlign: "center", marginTop: "3%" }}>
        S Y S T E M - A P P S
      </h1>
      <div>
      <a>
        <img
          src={
            "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQVY2MgZ8mCG5fNoOJRMHhrOSv_RCq3DknlrwzoYyM_XlJ-vJi5UoqYHNCxSqJninC5-1Q&usqp=CAU"
          }
          width="100px"
          height="100px"
          style={{
            borderRadius: "25%",
            marginLeft: "-55%",
            marginTop: "10%",
            position: "absolute",
          }}
        />
      </a>
      <a
        style={{
          backgroundColor: "Transparent",
          border: "none",
          cursor: "pointer",
          outline: "none",
          color: "green",
          textDecoration: "none",
          fontWeight: "bold",
          marginRight: "1.5%",
        }}
        href="https://dynamicweatherapp.netlify.app"
        target="_blank"
      >
        <div style={{ flexDirection: "column" }}>
          <img
            src={Weather}
            width="60px"
            height="60px"
            style={{ borderRadius: "15px" }}
            class="Icons-animation"
          />
        </div>
      </a>
      &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
      </div>
    </div>
  );
}

export default DialogBox
